jQuery(document).ready(function(c){var d=detectIE();jQuery("html").addClass("dte-html");if(d===false){jQuery("html").addClass("ie-edge")}else{if(d>=12){jQuery("html").addClass("ie-edge-"+d)}else{jQuery("html").addClass("ie-"+d)}}c(".owl-carousel").owlCarousel({loop:true,nav:false,dots:true,items:1})});function detectIE(){var j=window.navigator.userAgent;var f=j.indexOf("MSIE ");if(f>0){return parseInt(j.substring(f+5,j.indexOf(".",f)),10)}var g=j.indexOf("Trident/");if(g>0){var h=j.indexOf("rv:");return parseInt(j.substring(h+3,j.indexOf(".",h)),10)}var i=j.indexOf("Edge/");if(i>0){return parseInt(j.substring(i+5,j.indexOf(".",i)),10)}return false};